import './title.scss';

const Title: React.FC = () => {
  return (
    <div className="mt-16 flex justify-center">
      <p className="bg-slate-800 inline-block w-min whitespace-nowrap	 text-white text-center	">
        DE 17 BELANGRIJKSTE
        <br /> NIEUWSMOMENTEN VAN 2017
        <br /> VOLGENS NU.NL
      </p>
    </div>
  );
};

export { Title };
